INSERT INTO `hl_comments` VALUES (1,1,'Sr. WordPress','','http://wordpress.org/','','2012-07-27 14:39:46','2012-07-27 14:39:46','Olá, isto é um comentário.<br />Para excluir um comentário, faça o login e veja os comentários dos posts. Lá você vai ter a opção de editá-los ou excluí-los.',0,'1','','',0,0),(2,1146,'Chris Ames','yo@chrisam.es','http://chrisam.es/','24.126.245.62','2013-03-15 18:16:59','2013-03-15 23:16:59','Ello! Pretend you\'re reading this comment with an English accent.',0,'1','','',0,0),(5,149,'Chris Ames','yo@chrisam.es','http://chrisam.es','59.167.157.3','2013-01-04 10:15:32','2013-01-04 16:15:32','There are a few checklist items that should be in each comment.\n\n<ul>\n<li>The commenter\'s <strong>gravatar</strong>. Optional, but a best practice. Use get_comment_author_email.</li>\n<li>The commenter\'s <strong>name</strong>. Use <a href=\"http://codex.wordpress.org/Function_Reference/comment_author\" title=\"Comment Author\" rel=\"nofollow\">comment_author</a>.</li>\n<li>The commenter\'s <strong>URL</strong>. Usually applied as a link to the commenter\'s name. Use <a href=\"http://codex.wordpress.org/Function_Reference/comment_author_url\" title=\"Comment Author URL\" rel=\"nofollow\">comment_author_url</a></li>\n<li>The <strong>date / time</strong> the comment was made. Use <a href=\"http://codex.wordpress.org/Function_Reference/get_comment_date\" title=\"Get Comment Date\" rel=\"nofollow\">get_comment_date</a>.</li>\n<li>A <strong>permalink</strong> to the comment. Usually applied as a link to the date / time of the comment. Use <a href=\"http://codex.wordpress.org/Function_Reference/get_comment_link\" title=\"Get Comment Link\" rel=\"nofollow\">get_comment_link</a></li>\n<li>Indication of a <strong>comment left by the post author</strong>. Style the <code>.bypostauthor</code> class.</li>\n<li>The <strong>comment text</strong>. Use <a href=\"http://codex.wordpress.org/Function_Reference/comment_text\" title=\"Comment Text\" rel=\"nofollow\">comment_text</a>.</li>\n<li>An <strong>edit</strong> comment link. Use <a href=\"http://codex.wordpress.org/Function_Reference/edit_comment_link\" title=\"Edit Comment Link\" rel=\"nofollow\">edit_comment_link</a>.</li>\n<li>A comment <strong>reply</strong> link. Used for threaded comments. Use <a href=\"http://codex.wordpress.org/Function_Reference/comment_reply_link\" title=\"Comment Reply Link\" rel=\"nofollow\">comment_reply_link</a>.</li>\n</ul>',0,'1','','',0,0),(6,149,'Tom McFarlin','tom@tommcfarlin.com','http://tommcfarlin.com','59.167.157.3','2012-09-03 10:18:04','2012-09-03 15:18:04','<h2>Headings</h2>\n\n<h1>Header one</h1>\n\n<h2>Header two</h2>\n\n<h3>Header three</h3>\n\n<h4>Header four</h4>\n\n<h5>Header five</h5>\n\n<h6>Header six</h6>\n\n<h2>Blockquotes</h2>\n\nSingle line blockquote:\n\n<blockquote>Stay hungry. Stay foolish.</blockquote>\n\nMulti line blockquote with a cite reference:\n\n<blockquote>People think focus means saying yes to the thing you\'ve got to focus on. But that\'s not what it means at all. It means saying no to the hundred other good ideas that there are. You have to pick carefully. I\'m actually as proud of the things we haven\'t done as the things I have done. Innovation is saying no to 1,000 things. <cite>Steve Jobs - Apple Worldwide Developers\' Conference, 1997</cite></blockquote>\n\n<h2>Tables</h2>\n\n<table>\n    <tbody>\n        <tr>\n            <th>Employee</th>\n            <th class=\"views\">Salary</th>\n            <th></th>\n        </tr>\n        <tr class=\"odd\">\n            <td><a href=\"http://john.do/\" rel=\"nofollow\">John Saddington</a></td>\n            <td>$1</td>\n            <td>Because that\'s all Steve Job\' needed for a salary.</td>\n        </tr>\n        <tr class=\"even\">\n            <td><a href=\"http://tommcfarlin.com/\" rel=\"nofollow\">Tom McFarlin</a></td>\n            <td>$100K</td>\n            <td>For all the blogging he does.</td>\n        </tr>\n        <tr class=\"odd\">\n            <td><a href=\"http://jarederickson.com/\" rel=\"nofollow\">Jared Erickson</a></td>\n            <td>$100M</td>\n            <td>Pictures are worth a thousand words, right? So Tom x 1,000.</td>\n        </tr>\n        <tr class=\"even\">\n            <td><a href=\"http://chrisam.es/\" rel=\"nofollow\">Chris Ames</a></td>\n            <td>$100B</td>\n            <td>With hair like that?! Enough said...</td>\n        </tr>\n    </tbody>\n</table>\n\n<h2>Definition Lists</h2>\n\n<dl>\n    <dt>Definition List Title</dt>\n    <dd>Definition list division.</dd>\n    <dt>Startup</dt>\n    <dd>A startup company or startup is a company or temporary organization designed to search for a repeatable and scalable business model.</dd>\n    <dt>#dowork</dt>\n    <dd>Coined by Rob Dyrdek and his personal body guard Christopher \"Big Black\" Boykins, \"Do Work\" works as a self motivator, to motivating your friends.</dd>\n    <dt>Do It Live</dt>\n    <dd>I\'ll let Bill O\'Reilly will <a href=\"https://www.youtube.com/watch?v=O_HyZ5aW76c\" title=\"We\'ll Do It Live\" rel=\"nofollow\">explain</a> this one.</dd>\n</dl>\n\n<h2>Unordered Lists (Nested)</h2>\n\n<ul>\n    <li>List item one\n        <ul>\n            <li>List item one\n                <ul>\n                    <li>List item one</li>\n                    <li>List item two</li>\n                    <li>List item three</li>\n                    <li>List item four</li>\n            	</ul>\n            </li>\n            <li>List item two</li>\n            <li>List item three</li>\n            <li>List item four</li>\n        </ul>\n    </li>\n	<li>List item two</li>\n	<li>List item three</li>\n	<li>List item four</li>\n</ul>\n\n<h2>Ordered List (Nested)</h2>\n\n<ol>\n    <li>List item one\n        <ol>\n            <li>List item one\n                <ol>\n                    <li>List item one</li>\n                    <li>List item two</li>\n                    <li>List item three</li>\n                    <li>List item four</li>\n                </ol>\n            </li>\n            <li>List item two</li>\n            <li>List item three</li>\n            <li>List item four</li>\n        </ol>\n    </li>\n    <li>List item two</li>\n    <li>List item three</li>\n    <li>List item four</li>\n</ol>\n\n<h2>HTML Tags</h2>\n\nThese supported tags come from the WordPress.com code <a href=\"http://en.support.wordpress.com/code/\" title=\"Code\" rel=\"nofollow\">FAQ</a>.\n\n<strong>Address Tag</strong>\n\n<address>\n1 Infinite Loop\nCupertino, CA 95014\nUnited States\n</address>\n\n<strong>Anchor Tag (aka. Link)</strong>\n\nThis is an example of a <a href=\"http://apple.com\" title=\"Apple\" rel=\"nofollow\">link</a>.\n\n<strong>Abbreviation Tag</strong>\n\nThe abbreviation <abbr title=\"Seriously\">srsly</abbr> stands for \"seriously\".\n\n<strong>Acronym Tag</strong>\n\nThe acronym <acronym title=\"For The Win\">ftw</acronym> stands for \"for the win\".\n\n<strong>Big Tag</strong>\n\nThese tests are a <big>big</big> deal, but this tag is no longer supported in HTML5.\n\n<strong>Cite Tag</strong>\n\n\"Code is poetry.\" --<cite>Automattic</cite>\n\n<strong>Code Tag</strong>\n\nYou will learn later on in these tests that <code>word-wrap: break-word;</code> will be your best friend.\n\n<strong>Delete Tag</strong>\n\nThis tag will let you <del>strikeout text</del>, but this tag is no longer supported in HTML5 (use the <code>&lt;strike&gt;</code> instead).\n\n<strong>Emphasize Tag</strong>\n\nThe emphasize tag should <em>italicize</em> text.\n\n<strong>Insert Tag</strong>\n\nThis tag should denote <ins>inserted</ins> text.\n\n<strong>Keyboard Tag</strong>\n\nThis scarsly known tag emulates <kbd>keyboard text</kbd>, which is usually styled like the <code>&lt;code&gt;</code> tag.\n\n<strong>Preformatted Tag</strong>\n\nThis tag styles large blocks of code.\n\n<pre>\n.post-title {\n	margin: 0 0 5px;\n	font-weight: bold;\n	font-size: 38px;\n	line-height: 1.2;\n}\n</pre>\n\n<strong>Quote Tag</strong>\n\n<q>Developers, developers, developers...</q> --Steve Ballmer\n\n<strong>Strong Tag</strong>\n\nThis tag shows <strong>bold<strong> text.\n\n<strong>Subscript Tag</strong>\n\nGetting our science styling on with H<sub>2</sub>O, which should push the \"2\" down.\n\n<strong>Superscript Tag</strong>\n\nStill sticking with science and Isaac Newton\'s E = MC<sup>2</sup>, which should lift the 2 up.\n\n<strong>Teletype Tag</strong>\n\nThis rarely used tag emulates <tt>teletype text</tt>, which is usually styled like the <code>&lt;code&gt;</code> tag.\n\n<strong>Variable Tag</strong>\n\nThis allows you to denote <var>variables</var>.',0,'1','','',0,0),(24,149,'Anonymous User','fake@email.com','','67.3.69.40','2013-03-11 23:45:54','2013-03-12 04:45:54','This user it trying to be anonymous.\n\n<ul>\n    <li>They used a fake email, so there should be no <a href=\"http://gravatar.com/\" title=\"Gravatar\" rel=\"nofollow\">Gravatar</a> associated with it.</li>\n    <li>They did not speify a website, so there should be no link to it in the comment.</li>\n</ul>',0,'1','','',0,0),(25,149,'Jason bradley','jason.bradley@me.com','http://everchangingmedia.com/','204.54.106.1','2013-03-12 13:17:35','2013-03-12 18:17:35','Comments? I love comments!',0,'1','','',0,0),(26,149,'Matt Mullenweg','m@mullenweg.com','http://ma.tt/','24.126.245.62','2013-03-14 07:53:26','2013-03-14 12:53:26','These tests are amazing!',0,'1','','',0,0),(28,149,'Michael Novotny','manovotny@gmail.com','','24.126.245.62','2013-03-14 07:56:46','2013-03-14 12:56:46','Author Comment.',0,'1','','',0,2),(29,149,'Jared Erickson','jared@lessmade.com','http://jarederickson.com/','24.126.245.62','2013-03-14 07:57:01','2013-03-14 12:57:01','Comment Depth 01',0,'1','','',0,0),(30,149,'Chris Ames','yo@chrisam.es','http://chrisam.es/','24.126.245.62','2013-03-14 08:01:21','2013-03-14 13:01:21','Comment Depth 02',0,'1','','',29,0),(31,149,'John Saddington','me@john.do','http://john.do/','24.126.245.62','2013-03-14 08:02:06','2013-03