INSERT INTO `hl_posts` VALUES (1,1,'2012-07-27 14:39:46','2012-07-27 14:39:46','Bem-vindo ao WordPress. Esse é o seu primeiro post. Edite-o ou exclua-o, e então comece a publicar!','Olá, mundo!','','publish','open','open','','ola-mundo','','','2012-07-27 14:39:46','2012-07-27 14:39:46','',0,'http://instituto-tim.mu/?p=1',0,'post','',1),(2,1,'2012-07-27 14:39:46','2012-07-27 14:39:46','Este é o exemplo de uma página. É diferente de um post de blog porque é estática e pode aparecer em menus de navegação (na maioria dos temas). A maioria das pessoas começam com uma página \'Sobre\' que as apresenta aos potenciais visitantes do site. Você pode usar algo como:\n\n<blockquote>Oi! Sou um estudante de Biologia e gosto de esportes e natureza. Nos fins-de-semana pratico futebol com meus amigos no clube local. Eu moro em Valinhos e fiz este site para falar sobre minha cidade.</blockquote>\n\n...ou algo como:\n\n<blockquote>A empresa Logos foi fundada em 1980, e tem provido o comércio local com o que há de melhor em informatização. Localizada em Recife, nossa empresa tem se destacado como um das que também contribuem para o descarte correto de equipamentos eletrônicos substituídos.</blockquote>\n\nComo um novo usuário WordPress, vá ao seu <a href=\"http://instituto-tim.mu/wp-admin/\">Painel</a> para excluir este conteúdo e criar o seu. Divirta-se!','Página de Exemplo','','publish','open','open','','pagina-exemplo','','','2012-07-27 14:39:46','2012-07-27 14:39:46','',0,'http://instituto-tim.mu/?page_id=2',0,'page','',0),(1286,1,'2013-10-11 14:13:33','2013-10-11 14:13:33','','Captura de tela de 2013-06-25 12:00:07','','inherit','open','open','','captura-de-tela-de-2013-06-25-120007','','','2013-10-11 14:13:33','2013-10-11 14:13:33','',418,'http://instituto-tim.mu/wp-content/uploads/2050/01/Captura-de-tela-de-2013-06-25-120007.png',0,'attachment','image/png',0),(611,2,'2011-01-10 06:17:54','2011-01-10 13:17:54','','canola2','Lorem ipsum dolor sit amet, consectetuer adipiscing elit