li>Navigate to <strong><em>Settings &gt; Reading</em></strong> in the WordPress admin.</li>\n	<li>Then use the settings in the screenshot below.</li>\n</ul>\n<img class=\"alignnone size-full wp-image-1071\" alt=\"Static Pages\" src=\"http://instituto-tim.mu/wp-content/uploads/2013/03/static-pages.png\" width=\"1390\" height=\"1022\" />\n\nA few things to check once this is done.\n<ul>\n	<li>Navigating to the root URL loads this page.</li>\n	<li>The site title should be an <code>H1</code> and the page title should be an <code>H2</code> (if displayed).</li>\n	<li>Check that the browser window / tab name is what you intend it to show.</li>\n	<li>If your theme displays breadcrumbs, they should probably not show when this page is the front page.</li>\n</ul>','Home','','publish','open','open','','home','','','2013-03-15 17:56:11','2013-03-15 22:56:11','',0,'http://wptest.io/demo/?page_id=1064',0,'page','',0),(1066,2,'2013-03-15 17:59:55','2013-03-15 22:59:55','Note that you will probably want to test this page in conjunction with the <span style=\"text-decoration: underline;\"><strong>Home</strong></span> page.\n\nTo test this page:\n<ul>\n	<li><span style=\"line-height: 1.714285714; font-size: 1rem;\">Navigate to </span><strong style=\"line-height: 1.714285714; font-size: 1rem;\"><em>Settings &gt; Reading</em></strong><span style=\"line-height: 1.714285714; font-size: 1rem;\"> in the WordPress admin.</span></li>\n	<li><span style=\"font-size: 1rem; line-height: 1.714285714;\">Then use the settings in the screenshot below.</span></li>\n</ul>\n<img class=\"alignnone size-full wp-image-1071\" alt=\"Static Pages\" src=\"http://instituto-tim.mu/wp-content/uploads/2013/03/static-pages.png\" width=\"1390\" height=\"1022\" />\n\nA few things to check once this is done.\n<ul>\n	<li>Navigating to the Blog page does <span style=\"text-decoration: underline;\"><strong>not</strong></span> display this page. It should display blog posts.</li>\n	<li><span style=\"line-height: 1.714285714; font-size: 1rem;\">Check that the browser window / tab name is what you intend it to show.</span></li>\n	<li>If your theme displays breadcrumbs, they should probably not show when this is the posts page.</li>\n</ul>','Blog','','publish','open','open','','blog','','','2013-03-15 17:59:55','2013-03-15 22:59:55','',0,'http://wptest.io/demo/?page_id=1066',0,'page','',0),(1145,2,'2013-03-15 18:15:14','2013-03-15 23:15:14','This page has its comments, pingbacks, and trackbacks disabled.\n\nThere should be no comment reply form or any pingbacks and trackbacks listed.','Page Comments Disabled','','publish','closed','closed','','page-comments-disabled','','','2013-03-15 18:15:14','2013-03-15 23:15:14','',0,'http://wptest.io/demo/?page_id=1075',0,'page','',0),(1146,2,'2013-03-15 18:16:08','2013-03-15 23:16:08','This post has its comments, pingbacks, and trackbacks enabled.\n\nIf your theme support comments on pages, then they should show up below.','Page Comments','','publish','open','open','','page-comments','','','2013-03-15 18:16:08','2013-03-15 23:16:08','',0,'http://wptest.io/demo/?page_id=1077',0,'page','',1),(1147,2,'2013-03-15 18:19:23','2013-03-15 23:19:23','<span style=\"line-height: 1.714285714; font-size: 1rem;\">Welcome to image alignment! The best way to demonstrate the ebb and flow of the various image positioning options is to nestle them snuggly among an ocean of words. Grab a paddle and let\'s get started.</span>\n\nOn the topic of alignment, it should be noted that users can choose from the options of <em>None</em>, <em>Left</em>, <em>Right, </em>and <em>Center</em>. In addition, they also get the options of <em>Thumbnail</em>, <em>Medium</em>, <em>Large</em> &amp; <em>Fullsize</em>.\n<p style=\"text-align: center;\"><img class=\"size-full wp-image-906 aligncenter\" title=\"Image Alignment 580x300\" alt=\"Image Alignment 580x300\" src=\"http://instituto-tim.mu/wp-content/uploads/2013/03/image-alignment-580x300.jpg\" width=\"580\" height=\"300\" /></p>\nThe image above happens to be <em><strong>centered</strong></em>.\n\n<strong><img class=\"size-full wp-image-904 alignleft\" title=\"Image Alignment 150x150\" alt=\"Image Alignment 150x150\" src=\"http://instituto-tim.mu/wp-content/uploads/2013/03/image-alignment-150x150.jpg\" width=\"150\" height=\"150\" /></strong>The rest of this paragraph is filler for the sake of seeing the text wrap around the 150x150 image, which is <em><strong>left aligned</strong></em>. <strong></strong>\n\nAs you can see the should be some space above, below, and to the right of the image. The text should not be creeping on the image. Creeping is just not right. Images need breathing room too. Let them speak like you words. Let them do their jobs without any hassle from the text. In about one more sentence here, we\'ll see that the text moves from the right of the image down below the image in seamless transition. Again, letting the do it\'s thang. Mission accomplished!\n\nAnd now for a <em><strong>massively large image</strong></em>. It also has <em><strong>no alignment</strong></em>.\n\n<img class=\"alignnone  wp-image-907\" title=\"Image Alignment 1200x400\" alt=\"Image Alignment 1200x400\" src=\"http://instituto-tim.mu/wp-content/uploads/2013/03/image-alignment-1200x4002.jpg\" width=\"1200\" height=\"400\" />\n\nThe image above, though 1200px wide, should not overflow the content area. It should remain contained with no visible disruption to the flow of content.\n\n<img class=\"size-full wp-image-905 alignright\" title=\"Image Alignment 300x200\" alt=\"Image Alignment 300x200\" src=\"http://instituto-tim.mu/wp-content/uploads/2013/03/image-alignment-300x200.jpg\" width=\"300\" height=\"200\" />\n\nAnd now we\'re going to shift things to the <em><strong>right align</strong></em>. Again, there should be plenty of room above, below, and to the left of the image. Just look at him there... Hey guy! Way to rock that right side. I don\'t care what the left aligned image says, you look great. Don\'t let anyone else tell you differently.\n\nIn just a bit here, you should see the text start to wrap below the right aligned image and settle in nicely. There should still be plenty of room and everything should be sitting pretty. Yeah... Just like that. It never felt so good to be right.\n\nAnd just when you thought we were done, we\'re going to do them all over again with captions!\n\n[caption id=\"attachment_906\" align=\"aligncenter\" width=\"580\"]<img class=\"size-full wp-image-906  \" title=\"Image Alignment 580x300\" alt=\"Image Alignment 580x300\" src=\"http://instituto-tim.mu/wp-content/uploads/2013/03/image-alignment-580x300.jpg\" width=\"580\" height=\"300\" /> Look at 580x300 getting some <a title=\"Image Settings\" href=\"http://en.support.wordpress.com/images/image-settings/\">caption</a> love.[/caption]\n\nThe image above happens to be <em><strong>centered</strong></em>. The caption also has a link in it, just to see if it does anything funky.\n\n[caption id=\"attachment_904\" align=\"alignleft\" width=\"150\"]<img class=\"size-full wp-image-904  \" title=\"Image Alignment 150x150\" alt=\"Image Alignment 150x150\" src=\"http://instituto-tim.mu/wp-content/uploads/2013/03/image-alignment-150x150.jpg\" width=\"150\" height=\"150\" /> Itty-bitty caption.[/caption]\n\n<strong></strong>The rest of this paragraph is filler for the sake of seeing the text wrap around the 150x150 image, which is <em><strong>left aligned</strong></em>. <strong></strong>\n\nAs you can see the should be some space above, below, and to the right of the image. The text should not be creeping on the image. Creeping is just not right. Images need breathing room too. Let them speak like you words. Let them do their jobs without any hassle from the text. In about one more sentence here, we\'ll see that the text moves from the right of the image down below the image in seamless transition. Again, letting the do it\'s thang. Mission accomplished!\n\nAnd now for a <em><strong>massively large image</strong></em>. It also has <em><strong>no alignment</strong></em>.\n\n[caption id=\"attachment_907\" align=\"alignnone\" width=\"1200\"]<img class=\" wp-image-907\" title=\"Image Alignment 1200x400\" alt=\"Image Alignment 1200x400\" src=\"http://instituto-tim.mu/wp-content/uploads/2013/03/image-alignment-1200x4002.jpg\" width=\"1200\" height=\"400\" /> Massive image comment for your eyeballs.[/caption]\n\nThe image above, though 1200px wide, should not overflow the content area. It should remain contained with no visible disruption to the flow of content.\n\n[caption id=\"attachment_905\" align=\"alignright\" width=\"300\"]<img class=\"size-full wp-image-905 \" title=\"Image Alignment 300x200\" alt=\"Image Alignment 300x200\" src=\"http://instituto-tim.mu/wp-content/uploads/2013/03/image-alignment-300x200.jpg\" width=\"300\" height=\"200\" /> Feels good to be right all the time.[/caption]\n\nAnd now we\'re going to shift things to the <em><strong>right align</strong></em>. Again, there should be plenty of room above, below, and to the left of the image. Just look at him there... Hey guy! Way to rock that right side. I don\'t care what the left aligned image says, you look great. Don\'t let anyone else tell you differently.\n\nIn just a bit here, you should see the text start to wrap below the right aligned image and settle in nicely. There should still be plenty of room and everything should be sitting pretty. Yeah... Just like that. It never felt so good to be right.\n\nAnd that\'s a wrap, yo! You survived the tumultuous waters of alignment. Image alignment achievement unlocked!','Page Image Alignment','','publish','open','open','','page-image-alignment','','','2013-03-15 18:19:23','2013-03-15 23:19:23','',0,'http://wptest.io/demo/?page_id=1080',0,'page','',0),(1148,2,'2013-03-15 18:20:05','2013-03-15 23:20:05','<h2>Headings</h2>\n<h1>Header one</h1>\n<h2>Header two</h2>\n<h3>Header three</h3>\n<h4>Header four</h4>\n<h5>Header five</h5>\n<h6>Header six</h6>\n<h2>Blockquotes</h2>\nSingle line blockquote:\n<blockquote>Stay hungry. Stay foolish.</blockquote>\nMulti line blockquote with a cite reference:\n<blockquote>People think focus means saying yes to the thing you\'ve got to focus on. But that\'s not what it means at all. It means saying no to the hundred other good ideas that there are. You have to pick carefully. I\'m actually as proud of the things we haven\'t done as the things I have done. Innovation is saying no to 1,000 things. <cite>Steve Jobs - Apple Worldwide Developers\' Conference, 1997</cite></blockquote>\n<h2>Tables</h2>\n<table>\n<tbody>\n<tr>\n<th>Employee</th>\n<th class=\"views\">Salary</th>\n<th></th>\n</tr>\n<tr class=\"odd\">\n<td><a href=\"http://john.do/\">John Saddington</a></td>\n<td>$1</td>\n<td>Because that\'s all Steve Job\' needed for a salary.</td>\n</tr>\n<tr class=\"even\">\n<td><a href=\"http://tommcfarlin.com/\">Tom McFarlin</a></td>\n<td>$100K</td>\n<td>For all the blogging he does.</td>\n</tr>\n<tr class=\"odd\">\n<td><a href=\"http://jarederickson.com/\">Jared Erickson</a></td>\n<td>$100M</td>\n<td>Pictures are worth a thousand words, right? So Tom x 1,000.</td>\n</tr>\n<tr class=\"even\">\n<td><a href=\"http://chrisam.es/\">Chris Ames</a></td>\n<td>$100B</td>\n<td>With hair like that?! Enough said...</td>\n</tr>\n</tbody>\n</table>\n<h2>Definition Lists</h2>\n<dl><dt>Definition List Title</dt><dd>Definition list division.</dd><dt>Startup</dt><dd>A startup company or startup is a company or temporary organization designed to search for a repeatable and scalable business model.</dd><dt>#dowork</dt><dd>Coined by Rob Dyrdek and his personal body guard Christopher \"Big Black\" Boykins, \"Do Work\" works as a self motivator, to motivating your friends.</dd><dt>Do It Live</dt><dd>I\'ll let Bill O\'Reilly will <a title=\"We\'ll Do It Live\" href=\"https://www.youtube.com/watch?v=O_HyZ5aW76c\">explain</a> this one.</dd></dl>\n<h2>Unordered Lists (Nested)</h2>\n<ul>\n	<li>List item one\n<ul>\n	<li>List item one\n<ul>\n	<li>List item one</li>\n	<li>List item two</li>\n	<li>List item three</li>\n	<li>List item four</li>\n</ul>\n</li>\n	<li>List item two</li>\n	<li>List item three</li>\n	<li>List item four</li>\n</ul>\n</li>\n	<li>List item two</li>\n	<li>List item three</li>\n	<li>List item four</li>\n</ul>\n<h2>Ordered List (Nested)</h2>\n<ol>\n	<li>List item one\n<ol>\n	<li>List item one\n<ol>\n	<li>List item one</li>\n	<li>List item two</li>\n	<li>List item three</li>\n	<li>List item four</li>\n</ol>\n</li>\n	<li>List item two</li>\n	<li>List item three</li>\n	<li>List item four</li>\n</ol>\n</li>\n	<li>List item two</li>\n	<li>List item three</li>\n	<li>List item four</li>\n</ol>\n<h2>HTML Tags</h2>\nThese supported tags come from the WordPress.com code <a title=\"Code\" href=\"http://en.support.wordpress.com/code/\">FAQ</a>.\n\n<strong>Address Tag</strong>\n\n<address>1 Infinite Loop\nCupertino, CA 95014\nUnited States</address><strong>Anchor Tag (aka. Link)</strong>\n\nThis is an example of a <a title=\"Apple\" href=\"http://apple.com\">link</a>.\n\n<strong>Abbreviation Tag</strong>\n\nThe abbreviation <abbr title=\"Seriously\">srsly</abbr> stands for \"seriously\".\n\n<strong>Acronym Tag</strong>\n\nThe acronym <acronym title=\"For The Win\">ftw</acronym> stands for \"for the win\".\n\n<strong>Big Tag</strong>\n\nThese tests are a <big>big</big> deal, but this tag is no longer supported in HTML5.\n\n<strong>Cite Tag</strong>\n\n\"Code is poetry.\" --<cite>Automattic</cite>\n\n<strong>Code Tag</strong>\n\nYou will learn later on in these tests that <code>word-wrap: break-word;</code> will be your best friend.\n\n<strong>Delete Tag</strong>\n\nThis tag will let you <del>strikeout text</del>, but this tag is no longer supported in HTML5 (use the <code>&lt;strike&gt;</code> instead).\n\n<strong>Emphasize Tag</strong>\n\nThe emphasize tag should <em>italicize</em> text.\n\n<strong>Insert Tag</strong>\n\nThis tag should denote <ins>inserted</ins> text.\n\n<strong>Keyboard Tag</strong>\n\nThis scarsly known tag emulates <kbd>keyboard text</kbd>, which is usually styled like the <code>&lt;code&gt;</code> tag.\n\n<strong>Preformatted Tag</strong>\n\nThis tag styles large blocks of code.\n<pre>.post-title {\n	margin: 0 0 5px;\n	font-weight: bold;\n	font-size: 38px;\n	line-height: 1.2;\n}</pre>\n<strong>Quote Tag</strong>\n\n<q>Developers, developers, developers...</q> --Steve Ballmer\n\n<strong>Strong Tag</strong>\n\nThis tag shows <strong>bold<strong> text.</strong></strong>\n\n<strong>Subscript Tag</strong>\n\nGetting our science styling on with H<sub>2</sub>O, which should push the \"2\" down.\n\n<strong>Superscript Tag</strong>\n\nStill sticking with science and Isaac Newton\'s E = MC<sup>2</sup>, which should lift the 2 up.\n\n<strong>Teletype Tag</strong>\n\nThis rarely used tag emulates <tt>teletype text</tt>, which is usually styled like the <code>&lt;code&gt;</code> tag.\n\n<strong>Variable Tag</strong>\n\nThis allows you to denote <var>variables</var>.','Page Markup And Formatting','','publish','open','open','','page-markup-and-formatting','','','2013-03-15 18:20:05','2013-03-15 23:20:05','',0,'http://wptest.io/demo/?page_id=1083',0,'page','',0),(1149,2,'2013-03-15 18:21:12','2013-03-15 23:21:12','<a title=\"WP Test - The Best Tests For WordPress\" href=\"http://wptest.io\" target=\"_blank\">WP Test</a> is a fantastically exhaustive set of test data to measure the integrity of your plugins and themes.\n\nThe foundation of these tests are derived from <a title=\"Theme Unit Test\" href=\"http://codex.wordpress.org/Theme_Unit_Test\" target=\"_blank\">WordPress’ Theme Unit Test Codex</a> data. It’s paired with lessons learned from over three years of theme and plugin support, and baffling corner cases, to create a potent cocktail of simulated, quirky user content.\n\nThe word \"comprehensive\" was purposely left off this description. It\'s not. There will always be something new squarely scenario to test. That\'s where you come in. <a title=\"Contact\" href=\"http://wptest.io/contact/\">Let us know</a> of a test we\'re not covering. We\'d love to squash it.\n\nLet’s make WordPress testing easier and resilient together.','About','','publish','open','open','','about','','','2013-03-15 18:21:12','2013-03-15 23:21:12','',0,'http://wptest.io/demo/?page_id=1086',0,'page','',0),(1150,2,'2013-03-15 18:24:09','2013-03-15 23:24:09','This page the a parent page.\n\nIt contains child pages.','Parent Page','','publish','open','open','','parent-page','','','2013-03-15 18:24:09','2013-03-15 23:24:09','',0,'http://wptest.io/demo/?page_id=1088',0,'page','',0),(1151,2,'2013-03-15 18:25:40','2013-03-15 23:25:40','This is a child page.','Child Page 01','','publish','open','open','','child-page-01','','','2013-03-15 18:25:40','2013-03-15 23:25:40','',1150,'http://wptest.io/demo/?page_id=1090',0,'page','',0),(1152,2,'2013-03-15 18:25:51','2013-03-15 23:25:51','This is a child page.','Child Page 02','','publish','open','closed','','child-page-02','','','2013-03-15 18:25:51','2013-03-15 23:25:51','',1150,'http://wptest.io/demo/?page_id=1092',0,'page','',0),(1153,2,'2013-03-15 18:26:23','2013-03-15 23:26:23','This is a child page.\n\nAnd, just for fun, it also contains a child page (aka. a grandchild page).','Child Page 03','','publish','open','closed','','child-page-03','','','2013-03-15 18:26:23','2013-03-15 23:26:23','',1150,'http://wptest.io/demo/?page_id=1094',0,'page','',0),(1154,2,'2013-03-15 18:26:40','2013-03-15 23:26:40','This is a child page.','Child Page 04','','publish','open','open','','child-page-04','','','2013-03-15 18:26:40','2013-03-15 23:26:40','',1150,'http://wptest.io/demo/?page_id=1096',0,'page','',0),(1155,2,'2013-03-15 18:27:40','2013-03-15 23:27:40','This is a child page.','Child Page 05','','publish','open','open','','child-page-05','','','2013-03-15 18:27:40','2013-03-15 23:27:40','',1150,'http://wptest.io/demo/?page_id=1098',0,'page','',0),(1156,1,'2013-09-2