span style=\"line-height: 1.714285714; font-size: 1rem;\">Comment videos</span></li>\n	<li>Author comments</li>\n	<li>Gravatars and default fallbacks</li>\n</ul>\n&nbsp;','Comments','','publish','open','closed','','comments','','','2013-01-03 10:11:37','2013-01-03 16:11:37','',0,'http://wpthemetestdata.wordpress.com/2007/09/04/comment-test/',0,'post','',21),(151,2,'2013-01-01 10:17:18','2013-01-01 16:17:18','This post has many pingpacks and trackbacks.\n\nThere are a few ways to list them.\n<ol>\n	<li><span style=\"line-height: 1.714285714; font-size: 1rem;\">Above the comments.</span></li>\n	<li><span style=\"line-height: 1.714285714; font-size: 1rem;\">Below the comments</span></li>\n	<li><span style=\"line-height: 1.714285714; font-size: 1rem;\">Included within the normal flow of comments.</span></li>\n</ol>','Pingbacks And Trackbacks','','publish','closed','closed','','pingbacks-an-trackbacks','','','2013-01-01 10:17:18','2013-01-01 16:17:18','',0,'http://wpthemetestdata.wordpress.com/2007/09/04/many-trackbacks/',0,'post','',5),(152,5,'2013-01-02 10:21:15','2013-01-02 16:21:15','This post has its comments, pingbacks, and trackbacks disabled.\n\nThere should be no comment reply form or any pingbacks and trackbacks listed.','Comments Disabled','','publish','closed','closed','','comments-disabled','','','2013-01-02 10:21:15','2013-01-02 16:21:15','',0,'http://wpthemetestdata.wordpress.com/2007/09/04/no-comments/',0,'post','',0),(167,2,'2012-11-01 01:00:34','2012-11-01 06:00:34','This post has many tags.','Many Tags','','publish','closed','closed','','many-tags','','','2012-11-01 01:00:34','2012-11-01 06:00:34','',0,'http://wpthemetestdata.wordpress.com/2007/11/24/many-tags/',0,'post','',0),(168,2,'2012-11-02 02:00:03','2012-11-02 07:00:03','This post has many categories.','Many Categories','','publish','closed','closed','','many-categories','','','2012-11-02 02:00:03','2012-11-02 07:00:03','',0,'http://wpthemetestdata.wordpress.com/2007/11/24/many-categories/',0,'post','',0),(418,2,'2050-01-01 12:00:18','2050-01-01 18:00:18','This post is scheduled to be published in the future.\r\n\r\nIt should not be displayed by the theme.','Scheduled','','future','open','closed','','scheduled','','','2013-10-11 14:13:44','2013-10-11 14:13:44','',0,'http://wpthemetestdata.wordpress.com/?p=418',0,'post','',0),(555,2,'2012-12-10 10:00:14','2012-12-10 16:00:14','[gallery]\n\n<!--nextpage-->\n\nYou can use this page to test the Theme\'s handling of the[gallery]\n\nshortcode, including the <code>columns</code> parameter, from 1 to 10 columns. Themes are only required to support the default setting (3 columns), so this page is entirely optional.\n<h2>One Column</h2>\n[gallery columns=\"1\"]\n<h2>Two Columns</h2>\n[gallery columns=\"2\"]\n<h2>Three Columns</h2>\n[gallery columns=\"3\"]\n<h2>Four Columns</h2>\n[gallery columns=\"4\"]\n<h2>Five Columns</h2>\n[gallery columns=\"5\"]\n<h2>Six Columns</h2>\n[gallery columns=\"6\"]\n<h2>Seven Columns</h2>\n[gallery columns=\"7\"]\n<h2>Eight Columns</h2>\n[gallery columns=\"8\"]\n<h2>Nine Columns</h2>\n[gallery columns=\"9\"]\n<h2>Ten Columns</h2>\n[gallery columns=\"10\"]','Post Format: Gallery','','publish','open','open','','post-format-gallery','','','2012-12-10 10:00:14','2012-12-10 16:00:14','',0,'http://wpthemetestdata.wordpress.com/?p=555',0,'post','',0),(559,3,'2012-12-09 09:00:54','2012-12-09 15:00:54','We fundamentally believe that our customers are more interested in a simple, attractive, and functional WordPress theme than they are having 12 color schemes to choose from, and a fancy slider with 8 transition effects.\n\nIf you pick out a WordPress theme like you pick out drapes, you’re doing something wrong.','Post Format: Aside','','publish','open','open','','post-format-aside','','','2012-12-09 09:00:54','2012-12-09 15:00:54','',0,'http://wpthemetestdata.wordpress.com/?p=559',0,'post','',0),(562,4,'2012-12-08 08:00:31','2012-12-08 14:00:31','John: Are we still meeting for breakfast this morning?\n\nJohn: Where is the rest of the team? I\'ve been here since 3:00am.\n\nTom: Umm... We actually sleep. Go back to bed, dude.\n\nJohn: Fuuuuuuuuuuuu\n\nTom: Fine. But if I show up, I am not wearing pants.','Post Format: Chat','','publish','open','open','','post-format-chat','','','2012-12-08 08:00:31','2012-12-08 14:00:31','',0,'http://wpthemetestdata.wordpress.com/?p=562',0,'post','',0),(565,5,'2012-12-07 07:00:53','2012-12-07 13:00:53','<a title=\"Video Game Inspired Mural [Pics, Videos]\" href=\"http://wpdaily.co/mural/\" target=\"_blank\">8BIT\'s Office - Video Game Inspired Mural</a>','Post Format: Link','','publish','open','open','','post-format-link','','','2012-12-07 07:00:53','2012-12-07 13:00:53','',0,'http://wpthemetestdata.wordpress.com/?p=565',0,'post','',0),(568,2,'2012-12-05 05:00:39','2012-12-05 11:00:39','<dl class=\"wp-caption aligncenter\" id=\"attachment_612\" style=\"width: 650px;\"><dt class=\"wp-caption-dt\"></dt></dl><img class=\"alignnone size-full wp-image-967\" alt=\"Unicorn Wallpaper\" src=\"http://instituto-tim.mu/wp-content/uploads/2012/12/unicorn-wallpaper.jpg\" width=\"1600\" height=\"1200\" />\n\nI really love this wallpaper. It makes me think fondly of <a title=\"Chris Ames\" href=\"http://chrisam.es/\" target=\"_blank\">Chris Ames</a>.','Post Format: Image','','publish','open','open','','post-format-image','','','2012-12-05 05:00:39','2012-12-05 11:00:39','',0,'http://wpthemetestdata.wordpress.com/?p=568',0,'post','',0),(575,3,'2012-12-04 04:00:15','2012-12-04 10:00:15','<blockquote>I suggest a new strategy to you... Let the Wookie win.\n\n<a title=\"Let The Wookie Win\" href=\"http://www.youtube.com/watch?feature=player_detailpage&amp;v=mO6M4ngKRp0#t=30s\" target=\"_blank\">C-3PO</a></blockquote>','Post Format: Quote','','publish','open','open','','post-format-quote','','','2012-12-04 04:00:15','2012-12-04 10:00:15','',0,'http://wpthemetestdata.wordpress.com/?p=575',0,'post','',0),(579,7,'2012-12-03 03:00:24','2012-12-03 09:00:24','I\'ve been thinking a lot about spandex today.','Post Format: Status','','publish','open','open','','post-format-status','','','2012-12-03 03:00:24','2012-12-03 09:00:24','',0,'http://wpthemetestdata.wordpress.com/?p=579',0,'post','',0),(582,6,'2012-12-02 02:00:58','2012-12-02 08:00:58','http://www.youtube.com/watch?v=nwe-H6l4beM\n\nThe official music video of \"Rise Up\" from <a title=\"Eddy Music\" href=\"http://eddymusic.com/\" target=\"_blank\">Eddy\'s</a> <a title=\"Eddy - Start An Uproar! EP\" href=\"http://bit.ly/bVmAyI\" target=\"_blank\">Start An Uproar!</a> EP.\n\nLearn more about <a title=\"WordPress Embeds\" href=\"http://codex.wordpress.org/Embeds\" target=\"_blank\">WordPress Embeds</a>.','Post Format: Video','','publish','open','open','','post-format-video','','','2012-12-02 02:00:58','2012-12-02 08:00:58','',0,'http://wpthemetestdata.wordpress.com/?p=582',0,'post','',0),(587,6,'2012-12-01 01:00:44','2012-12-01 07:00:44','Link:\n\n<a href=\"http://instituto-tim.mu/wp-content/uploads/2013/03/Eddy-Need-Remix.mp3\">Eddy - Need (Remix)</a>\n\nShortcode:\n\n[audio http://instituto-tim.mu/wp-content/uploads/2013/03/Eddy-Need-Remix.mp3]','Post Format: Audio','','publish','open','open','','post-format-audio','','','2012-12-01 01:00:44','2012-12-01 07:00:44','',0,'http://wpthemetestdata.wordpress.com/?p=587',0,'post','',0),(674,4,'2012-12-06 06:00:19','2012-12-06 12:00:19','[caption id=\"attachment_963\" align=\"alignnone\" width=\"1131\"]<img class=\" wp-image-963\" title=\"Triforce Wallpaper\" alt=\"Triforce Wallpaper\" src=\"http://instituto-tim.mu/wp-content/uploads/2012/12/triforce-wallpaper.jpg\" width=\"1131\" height=\"707\" /> It\'s dangerous to go alone! Take this.[/caption]','Post Format: Image (Caption)','','publish','open','open','','post-format-image-caption','','','2012-12-06 06:00:19','2012-12-06 12:00:19','',0,'http://wpthemetestdata.wordpress.com/?p=674',0,'post','',0),(922,3,'2013-03-16 01:03:21','0000-00-00 00:00:00','This post is drafted and not published yet.\n\nIt should not be displayed by the theme.','Draft','','draft','open','open','','','','','2013-03-16 01:03:21','0000-00-00 00:00:00','',0,'http://wptest.io/demo/?p=922',0,'post','',0),(946,2,'2012-12-11 11:00:11','2012-12-11 17:00:11','<strong>This is an example of a standard post format</strong>.\n\nInspiration is a spark. A flash of light. Ignition. But without the proper mixture of oxygen and fuel, inspiration both lives and dies in the same instant. My life, my experiences, my research; these things are fertile soil for the great blog posts hidden within me. I carry them always and they are present when I sit down to do my work.\n\nBut all too often, it’s a struggle. The raw material is there, but the inspiration is not. The oxygen is abundant, but the fuel is scarce. And I’m left wondering, “How?”\n\nHow do I harvest? How do I sift and pan? How do I mine the caverns within me for intellectual and emotional gems? How do I… write?\n\nOr perhaps a better question is, how do you? Yes, <em>you</em>, my kindred blog reader. Surely, <em>you</em> are similar. Surely, <em>you’ve</em> wrestled the Great Muse down to the dusty earth, and won.\n\nI know this: it starts before I sit down to type. Great posts begin with significant life challenges. With weighty problems to solve. With an urgent need or a mature discontent with the way things are today. Yes, I think all great posts begin before words are written.\n\nSo get up, reader. Walk away from your keyboard, and live.\n\nOnly then can you give life… to words.','Post Format: Standard','','publish','open','open','','post-format-standard','','','2012-12-11 11:00:11','2012-12-11 17:00:11','',0,'http://wptest.io/demo/?p=946',0,'post','',0),(1005,2,'2012-12-02 03:00:34','2012-12-02 09:00:34','[wpvideo tFnqC9XQ w=680]\n\n<a title=\"VideoPress Plugin for WordPress\" href=\"http://videopress.com/\" target=\"_blank\">VideoPress</a>, especially as a video post format, usually provides some unique styling issues.\n\nYou will need to install <a title=\"Jetpack for WordPress\" href=\"http://jetpack.me/\" target=\"_blank\">Jetpack</a> or <a title=\"Slim Jetpack\" href=\"http://wordpress.org/extend/plugins/slimjetpack/\" target=\"_blank\">Slim Jetpack</a> plugin to turn the shortcode into a viewable video.','Post Format: Video (VideoPress)','','publish','open','open','','post-format-video-videopress','','','2012-12-02 03:00:34','2012-12-02 09:00:34','',0,'http://wptest.io/demo/?p=1005',0,'post','',0),(1162,2,'2013-03-15 18:28:48','2013-03-15 23:28:48','This is a grandchild page.','Grandchild Page','','publish','open','open','','grandchild-page','','','2013-03-15 18:28:48','2013-03-15 23:28:48','',1153,'http://wptest.io/demo/?page_id=1102',0,'page','',0),(131,4,'2013-01-04 09:38:05','2013-01-04 15:38:05','<span style=\"line-height: 1.714285714; font-size: 1rem;\">This content, comments, pingbacks, and trackbacks should not be visible until the password is entered.</span>','Password Protected (the password is \"enter\")','','publish','open','open','enter','password-protected','','','2013-01-04 09:38:05','2013-01-04 15:38:05','',0,'http://wpthemetestdata.wordpress.com/2007/09/04/test-with-secret-password/',0,'post','',1),(133,2,'2013-01-05 09:00:23','2013-01-05 15:00:23','This post has no title, but it still must link to the single post view somehow.\n\nThis is typically done by placing the permalink on the post date.','','','publish','closed','closed','','no-title','','','2013-01-05 09:00:23','2013-01-05 15:00:23','',0,'http://wpthemetestdata.wordpress.com/2007/09/04/14/',0,'post','',0),(134,5,'2013-01-06 09:39:56','2013-01-06 15:39:56','','No Content','','publish','open','open','','no-content','','','2013-01-06 09:39:56','2013-01-06 15:39:56','',0,'http://wpthemetestdata.wordpress.com/2007/09/04/this-post-has-no-body/',0,'post','',1),(188,2,'2013-01-08 10:00:20','2013-01-08 16:00:20','Post Page 1\n\n<!--nextpage-->\n\nPost Page 2\n\n<!--nextpage-->\n\nPost Page 3','Paginated','','publish','open','open','','paginated','','','2013-01-08 10:00:20','2013-01-08 16:00:20','',0,'http://noeltest.wordpress.com/?p=188',0,'post','',0),(861,5,'2013-01-05 10:00:49','2013-01-05 16:00:49','Verify that:\n<ul>\n	<li><span style=\"line-height: 1.714285714; font-size: 1rem;\">The post title renders the word \"with\" in </span><em style=\"line-height: 1.714285714; font-size: 1rem;\">italics</em><span style=\"line-height: 1.714285714; font-size: 1rem;\"> and the word \"markup\" in </span><strong style=\"line-height: 1.714285714; font-size: 1rem;\">bold</strong><span style=\"line-height: 1.714285714; font-size: 1rem;\">.</span></li>\n	<li><span style=\"line-height: 1.714285714; font-size: 1rem;\">The post title markup should be removed from the browser window / tab.</span></li>\n</ul>','Title With Markup','','publish','open','open','','title-with-markup','','','2013-01-05 10:00:49','2013-01-05 16:00:49','',0,'http://wptest.io/demo/?p=861',0,'post','',0),(867,7,'2013-01-05 11:00:20','2013-01-05 17:00:20','Putting special characters in the title should have no adverse effect on the layout or functionality.\n\nSpecial characters in the post title have been known to cause issues with JavaScript when it is minified, especially in the admin when editing the post itself (ie. issues with metaboxes, media upload, etc.).','Title With Special Characters ~`!@#$%^&*()-_=+{}[]/;:\'\"?,.>','','publish','open','open','','title-with-special-characters','','','2013-01-05 11:00:20','2013-01-05 17:00:20','',0,'http://wptest.io/demo/?p=867',0,'post','',0),(877,2,'2013-01-05 12:00:59','2013-01-05 18:00:59','Super/Duper/Long/NonBreaking/Path/Name/To/A/File/That/Is/Way/Deep/Down/In/Some/Mysterious/Remote/Desolate/Part/Of/The/Operating/System/To/A/File/That/Just/So/Happens/To/Be/Strangely/Named/Supercalifragilisticexpialidocious.txt\n\nA few things to check for:\n<ul>\n	<li><span style=\"line-height: 1.714285714; font-size: 1rem;\">Non-breaking text in the title, content, and comments should have no adverse effects on layout or functionality.</span></li>\n	<li><span style=\"line-height: 1.714285714; font-size: 1rem;\">Check the browser window / tab title.</span></li>\n	<li><span style=\"line-height: 1.714285714; font-size: 1rem;\">If you are a plugin or widget developer, check that this text does not break anything.</span></li>\n</ul>\nThe following CSS properties will help you support non-breaking text.\n<pre>-ms-word-wrap: break-word;\nword-wrap: break-word;</pre>\n&nbsp;','Super/Duper/Long/NonBreaking/Path/Name/To/A/File/That/Is/Way/Deep/Down/In/Some/Mysterious/Remote/Desolate/Part/Of/The/Operating/System/To/A/File/That/Just/So/Happens/To/Be/Strangely/Named/Supercalifragilisticexpialidocious.txt','','publish','open','open','','non-breaking-text','','','2013-01-05 12:00:59','2013-01-05 18:00:59','',0,'http://wptest.io/demo/?p=877',0,'post','',1),(895,3,'2013-01-09 09:00:39','2013-01-09 15:00:39','<h3>Default</h3>\nThis is a paragraph. It should not have any alignment of any kind. It should just flow like you would normally expect. Nothing fancy. Just straight up text, free flowing, with love. Completely neutral and not picking a side or sitting on the fence. It just is. It just freaking is. It likes where it is. It does not feel compelled to pick a side. Leave him be. It will just be better that way. Trust me.\n<h3>Left Align</h3>\n<p style=\"text-align: left;\">This is a paragraph. It is left aligned. Because of this, it is a bit more liberal in it\'s views. It\'s favorite color is green. Left align tends to be more eco-friendly, but it provides no concrete evidence that it really is. Even though it likes share the wealth evenly, it leaves the equal distribution up to justified alignment.</p>\n\n<h3>Center Align</h3>\n<p style=\"text-align: center;\">This is a paragraph. It is center aligned. Center is, but nature, a fence sitter. A flip flopper. It has a difficult time making up its mind. It wants to pick a side. Really, it does. It has the best intentions, but it tends to complicate matters more than help. The best you can do is try to win it over and hope for the best. I hear center align does take bribes.</p>\n\n<h3>Right Align</h3>\n<p style=\"text-align: right;\">This is a paragraph. It is right aligned. It is a bit more conservative in it\'s views. It\'s prefers to not be told what to do or how to do it. Right align totally owns a slew of guns and loves to head to the range for some practice. Which is cool and all. I mean, it\'s a pretty good shot from at least four or five football fields away. Dead on. So boss.</p>\n\n<h3>Justify Align</h3>\n<p style=\"text-align: justify;\">This is a paragraph. It is justify aligned. It gets really mad when people associate it with Justin Timberlake. Typically, justified is pretty straight laced. It likes everything to be in it\'s place and not all cattywampus like the rest of the aligns. I am not saying that makes it better than the rest of the aligns, but it does tend to put off more of an elitist attitude.</p>','Text Alignment','','publish','open','open','','text-alignment','','','2013-01-09 09:00:39','2013-01-09 15:00:39','',0,'http://wptest.io/demo/?p=895',0,'post','',0),(903,6,'2013-01-10 20:15:40','2013-01-11 02:15:40','<span style=\"line-height: 1.714285714; font-size: 1rem;\">Welcome to image alignment! The best way to demonstrate the ebb and flow of the various image positioning options is to nestle them snuggly among an ocean of words. Grab a paddle and let\'s get started.</span>\n\nOn the topic of alignment, it should be noted that users can choose from the options of <em>None</em>, <em>Left</em>, <em>Right, </em>and <em>Center</em>. In addition, they also get the options of <em>Thumbnail</em>, <em>Medium</em>, <em>Large</em> &amp; <em>Fullsize</em>.\n<p style=\"text-align: center;\"><img class=\"size-full wp-image-906 aligncenter\" title=\"Image Alignment 580x300\" alt=\"Image Alignment 580x300\" src=\"http://instituto-tim.mu/wp-content/uploads/2013/03/image-alignment-580x300.jpg\" width=\"580\" height=\"300\" /></p>\nThe image above happens to be <em><strong>centered</strong></em>.\n\n<strong><img class=\"size-full wp-image-904 alignleft\" title=\"Image Alignment 150x150\" alt=\"Image Alignment 150x150\" src=\"http://instituto-tim.mu/wp-content/uploads/2013/03/image-alignment-150x150.jpg\" width=\"150\" height=\"150\" /></strong>The rest of this paragraph is filler for the sake of seeing the text wrap around the 150x150 image, which is <em><strong>left aligned</strong></em>. <strong></strong>\n\nAs you can see the should be some space above, below, and to the right of the image. The text should not be creeping on the image. Creeping is just not right. Images need breathing room too. Let them speak like you words. Let them do their jobs without any hassle from the text. In about one more sentence here, we\'ll see that the text moves from the right of the image down below the image in seamless transition. Again, letting the do it\'s thang. Mission accomplished!\n\nAnd now for a <em><strong>massively large image</strong></em>. It also has <em><strong>no alignment</strong></em>.\n\n<img class=\"alignnone  wp-image-907\" title=\"Image Alignment 1200x400\" alt=\"Image Alignment 1200x400\" src=\"http://instituto-tim.mu/wp-content/uploads/2013/03/image-alignment-1200x4002.jpg\" width=\"1200\" height=\"400\" />\n\nThe image above, though 1200px wide, should not overflow the content area. It should remain contained with no visible disruption to the flow of content.\n\n<img class=\"size-full wp-image-905 alignright\" title=\"Image Alignment 300x200\" alt=\"Image Alignment 300x200\" src=\"http://instituto-tim.mu/wp-content/uploads/2013/03/image-alignment-300x200.jpg\" width=\"300\" height=\"200\" />\n\nAnd now we\'re going to shift things to the <em><strong>right align</strong></em>. Again, there should be plenty of room above, below, and to the left of the image. Just look at him there... Hey guy! Way to rock that right side. I don\'t care what the left aligned image says, you look great. Don\'t let anyone else tell you differently.\n\nIn just a bit here, you should see the text start to wrap below the right aligned image and settle in nicely. There should still be plenty of room and everything should be sitting pretty. Yeah... Just like that. It never felt so good to be right.\n\nAnd just when you thought we were done, we\'re going to do them all over again with captions!\n\n[caption id=\"attachment_906\" align=\"aligncenter\" width=\"580\"]<img class=\"size-full wp-image-906  \" title=\"Image Alignment 580x300\" alt=\"Image Alignment 580x300\" src=\"http://instituto-tim.mu/wp-content/uploads/2013/03/image-alignment-580x300.jpg\" width=\"580\" height=\"300\" /> Look at 580x300 getting some <a title=\"Image Settings\" href=\"http://en.support.wordpress.com/images/image-settings/\">caption</a> love.[/caption]\n\nThe image above happens to be <em><strong>centered</strong></em>. The caption also has a link in it, just to see if it does anything funky.\n\n[caption id=\"attachment_904\" align=\"alignleft\" width=\"150\"]<img class=\"size-full wp-image-904  \" title=\"Image Alignment 150x150\" alt=\"Image Alignment 150x150\" src=\"http://instituto-tim.mu/wp-content/uploads/2013/03/image-alignment-150x150.jpg\" width=\"150\" height=\"150\" /> Itty-bitty caption.[/caption]\n\n<strong></strong>The rest of this paragraph is filler for the sake of seeing the text wrap around the 150x150 image, which is <em><strong>left aligned</strong></em>. <strong></strong>\n\nAs you can see the should be some space above, below, and to the right of the image. The text should not be creeping on the image. Creeping is just not right. Images need breathing room too. Let them speak like you words. Let them do their jobs without any hassle from the text. In about one more sentence here, we\'ll see that the text moves from the right of the image down below the image in seamless transition. Again, letting the do it\'s thang. Mission accomplished!\n\nAnd now for a <em><strong>massively large image</strong></em>. It also has <em><strong>no alignment</strong></em>.\n\n[caption id=\"attachment_907\" align=\"alignnone\" width=\"1200\"]<img class=\" wp-image-907\" title=\"Image Alignment 1200x400\" alt=\"Image Alignment 1200x400\" src=\"http://instituto-tim.mu/wp-content/uploads/2013/03/image-alignment-1200x4002.jpg\" width=\"1200\" height=\"400\" /> Massive image comment for your eyeballs.[/caption]\n\nThe image above, though 1200px wide, should not overflow the content area. It should remain contained with no visible disruption to the flow of content.\n\n[caption id=\"attachment_905\" align=\"alignright\" width=\"300\"]<img class=\"size-full wp-image-905 \" title=\"Image Alignment 300x200\" alt=\"Image Alignment 300x200\" src=\"http://instituto-tim.mu/wp-content/uploads/2013/03/image-alignment-300x200.jpg\" width=\"300\" height=\"200\" /> Feels good to be right all the time.[/caption]\n\nAnd now we\'re going to shift things to the <em><strong>right align</strong></em>. Again, there should be plenty of room above, below, and to the left of the image. Just look at him there... Hey guy! Way to rock that right side. I don\'t care what the left aligned image says, you look great. Don\'t let anyone else tell you differently.\n\nIn just a bit here, you should see the text start to wrap below the right aligned image and settle in nicely. There should still be plenty of room and everything should be sitting pretty. Yeah... Just like that. It never felt so good to be right.\n\nAnd that\'s a wrap, yo! You survived the tumultuous waters of alignment. Image alignment achievement unlocked!','Image Alignment','','publish','open','open','','image-alignment','','','2013-01-10 20:15:40','2013-01-11 02:15:40','',0,'http://wptest.io/demo/?p=903',0,'post','',0),(919,4,'2013-01-11 20:22:19','2013-01-12 02:22:19','<h2>Headings</h2>\n<h1>Header one</h1>\n<h2>Header two</h2>\n<h3>Header three</h3>\n<h4>Header four</h4>\n<h5>Header five</h5>\n<h6>Header six</h6>\n<h2>Blockquotes</h2>\nSingle line blockquote:\n<blockquote>Stay hungry. Stay foolish.</blockquote>\nMulti line blockquote with a cite reference:\n<blockquote>People think focus means saying yes to the thing you\'ve got to focus on. But that\'s not what it means at all. It means saying no to the hundred other good ideas that there are. You have to pick carefully. I\'m actually as proud of the things we haven\'t done as the things I have done. Innovation is saying no to 1,000 things. <cite>Steve Jobs - Apple Worldwide Developers\' Conference, 1997</cite></blockquote>\n<h2>Tables</h2>\n<table>\n<tbody>\n<tr>\n<th>Employee</th>\n<th class=\"views\">Salary</th>\n<th></th>\n</tr>\n<tr class=\"odd\">\n<td><a href=\"http://john.do/\">John Saddington</a></td>\n<td>$1</td>\n<td>Because that\'s all Steve Job\' needed for a salary.</td>\n</tr>\n<tr class=\"even\">\n<td><a href=\"http://tommcfarlin.com/\">Tom McFarlin</a></td>\n<td>$100K</td>\n<td>For all the blogging he does.</td>\n</tr>\n<tr class=\"odd\">\n<td><a href=\"http://jarederickson.com/\">Jared Erickson</a></td>\n<td>$100M</td>\n<td>Pictures are worth a thousand words, right? So Tom x 1,000.</td>\n</tr>\n<tr class=\"even\">\n<td><a href=\"http://chrisam.es/\">Chris Ames</a></td>\n<td>$100B</td>\n<td>With hair like that?! Enough said...</td>\n</tr>\n</tbody>\n</table>\n<h2>Definition Lists</h2>\n<dl><dt>Definition List Title</dt><dd>Definition list division.</dd><dt>Startup</dt><dd>A startup company or startup is a company or temporary organization designed to search for a repeatable and scalable business model.</dd><dt>#dowork</dt><dd>Coined by Rob Dyrdek and his personal body guard Christopher \"Big Black\" Boykins, \"Do Work\" works as a self motivator, to motivating your friends.</dd><dt>Do It Live</dt><dd>I\'ll let Bill O\'Reilly will <a title=\"We\'ll Do It Live\" href=\"https://www.youtube.com/watch?v=O_HyZ5aW76c\">explain</a> this one.</dd></dl>\n<h2>Unordered Lists (Nested)</h2>\n<ul>\n	<li>List item one\n<ul>\n	<li>List item one\n<ul>\n	<li>List item one</li>\n	<li>List item two</li>\n	<li>List item three</li>\n	<li>List item four</li>\n</ul>\n</li>\n	<li>List item two</li>\n	<li>List item three</li>\n	<li>List item four</li>\n</ul>\n</li>\n	<li>List item two</li>\n	<li>List item three</li>\n	<li>List item four</li>\n</ul>\n<h2>Ordered List (Nested)</h2>\n<ol>\n	<li>List item one\n<ol>\n	<li>List item one\n<ol>\n	<li>List item one</li>\n	<li>List item two</li>\n	<li>List item three</li>\n	<li>List item four</li>\n</ol>\n</li>\n	<li>List item two</li>\n	<li>List item three</li>\n	<li>List item four</li>\n</ol>\n</li>\n	<li>List item two</li>\n	<li>List item three</li>\n	<li>List item four</li>\n</ol>\n<h2>HTML Tags</h2>\nThese supported tags come from the WordPress.com code <a title=\"Code\" href=\"http://en.support.wordpress.com/code/\">FAQ</a>.\n\n<strong>Address Tag</strong>\n\n<address>1 Infinite Loop\nCupertino, CA 95014\nUnited States</address><strong>Anchor Tag (aka. Link)</strong>\n\nThis is an example of a <a title=\"Apple\" href=\"http://apple.com\">link</a>.\n\n<strong>Abbreviation Tag</strong>\n\nThe abbreviation <abbr title=\"Seriously\">srsly</abbr> stands for \"seriously\".\n\n<strong>Acronym Tag</strong>\n\nThe acronym <acronym title=\"For The Win\">ftw</acronym> stands for \"for the win\".\n\n<strong>Big Tag</strong>\n\nThese tests are a <big>big</big> deal, but this tag is no longer supported in HTML5.\n\n<strong>Cite Tag</strong>\n\n\"Code is poetry.\" --<cite>Automattic</cite>\n\n<strong>Code Tag</strong>\n\nYou will learn later on in these tests that <code>word-wrap: break-word;</code> will be your best friend.\n\n<strong>Delete Tag</strong>\n\nThis tag will let you <del>strikeout text</del>, but this tag is no longer supported in HTML5 (use the <code>&lt;strike&gt;</code> instead).\n\n<strong>Emphasize Tag</strong>\n\nThe emphasize tag should <em>italicize</em> text.\n\n<strong>Insert Tag</strong>\n\nThis tag should denote <ins>inserted</ins> text.\n\n<strong>Keyboard Tag</strong>\n\nThis scarsly known tag emulates <kbd>keyboard text</kbd>, which is usually styled like the <code>&lt;code&gt;</code> tag.\n\n<strong>Preformatted Tag</strong>\n\nThis tag styles large blocks of code.\n<pre>.post-title {\n	margin: 0 0 5px;\n	font-weight: bold;\n	font-size: 38px;\n	line-height: 1.2;\n}</pre>\n<strong>Quote Tag</strong>\n\n<q>Developers, developers, developers...</q> --Steve Ballmer\n\n<strong>Strong Tag</strong>\n\nThis tag shows <strong>bold<strong> text.</strong></strong>\n\n<strong>Subscript Tag</strong>\n\nGetting our science styling on with H<sub>2</sub>O, which should push the \"2\" down.\n\n<strong>Superscript Tag</strong>\n\nStill sticking with science and Isaac Newton\'s E = MC<sup>2</sup>, which should lift the 2 up.\n\n<strong>Teletype Tag</strong>\n\nThis rarely used tag emulates <tt>teletype text</tt>, which is usually styled like the <code>&lt;code&gt;</code> tag.\n\n<strong>Variable Tag</strong>\n\nThis allows you to denote <var>variables</var>.','Markup And Formatting','','publish','open','open','','markup-and-formatting','','','2013-01-11 20:22:19','2013-01-12 02:22:19','',0,'http://wptest.io/demo/?p=919',0,'post','',0),(993,6,'2013-03-15 14:38:08','2013-03-15 19:38:08','This is the post content.','Excerpt','This is a post excerpt.','publish','open','open','','excerpt','','','2013-03-15 14:38:08','2013-03-15 19:38:08','',0,'http://wptest.io/demo/?p=993',0,'post','',0),(996,3,'2013-03-15 14:41:11','2013-03-15 19:41:11','This content is before the <a title=\"The More Tag\" href=\"http://en.support.wordpress.com/splitting-content/more-tag/\" target=\"_blank\">more tag</a>.\n\nRight after this sentence should be a \"continue reading\" button of some sort.\n\n<!--more-->\n\nAnd this content is after the more tag.','More Tag','','publish','open','open','','more-tag','','','2013-03-15 14:41:11','2013-03-15 19:41:11','',0,'http://wptest.io/demo/?p=996',0,'post','',0),(1000,2,'2013-03-15 14:48:32','2013-03-15 19:48:32','Nested and mixed lists are an interesting beast. It\'s a corner case to make sure that\n<ul>\n	<li><span style=\"line-height: 1.714285714; font-size: 1rem;\">Lists within lists do not break the ordered list numbering order</span></li>\n	<li><span style=\"line-height: 1.714285714; font-size: 1rem;\">Your list styles go deep enough.</span></li>\n</ul>\n<h3>Ordered - Unordered - Ordered</h3>\n<ol>\n	<li>ordered item</li>\n	<li>ordered item\n<ul>\n	<li><strong>unordered</strong></li>\n	<li><strong>unordered</strong>\n<ol>\n	<li>ordered item</li>\n	<li>ordered item</li>\n</ol>\n</li>\n</ul>\n</li>\n	<li>ordered item</li>\n	<li>ordered item</li>\n</ol>\n<h3>Ordered - Unordered - Unordered</h3>\n<ol>\n	<li>ordered item</li>\n	<li>ordered item\n<ul>\n	<li><strong>unordered</strong></li>\n	<li><strong>unordered</strong>\n<ul>\n	<li>unordered item</li>\n	<li>unordered item</li>\n</ul>\n</li>\n</ul>\n</li>\n	<li>ordered item</li>\n	<li>ordered item</li>\n</ol>\n<h3>Unordered - Ordered - Unordered</h3>\n<ul>\n	<li>unordered item</li>\n	<li>unordered item\n<ol>\n	<li>ordered</li>\n	<li>ordered\n<ul>\n	<li>unordered item</li>\n	<li>unordered item</li>\n</ul>\n</li>\n</ol>\n</li>\n	<li>unordered item</li>\n	<li>unordered item</li>\n</ul>\n<h3>Unordered - Unordered - Ordered</h3>\n<ul>\n	<li>unordered item</li>\n	<li>unordered item\n<ul>\n	<li>unordered</li>\n	<li>unordered\n<ol>\n	<li><strong>ordered item</strong></li>\n	<li><strong>ordered item</strong></li>\n</ol>\n</li>\n</ul>\n</li>\n	<li>unordered item</li>\n	<li>unordered item</li>\n</ul>','Nested And Mixed Lists','','publish','open','open','','nested-and-mixed-lists','','','2013-03-15 14:48:32','2013-03-15 19:48:32','',0,'http://wptest.io/demo/?p=1000',0,'post','',0),(1011,4,'2013-03-15 15:15:12','2013-03-15 20:15:12','This post should display a <a title=\"Featured Images\" href=\"http://en.support.wordpress.com/featured-images/#setting-a-featured-image\" target=\"_blank\">featured image</a>, if the theme <a title=\"Post Thumbnails\" href=\"http://codex.wordpress.org/Post_Thumbnails\" target=\"_blank\">supports it</a>.\n\nNon-square images can provide some unique styling issues.\n\nThis post tests a horizontal featured image.','Featured Image (Horizontal)','','publish','open','open','','featured-image-horizontal','','','2013-03-15 15:15:12','2013-03-15 20:15:12','',0,'http://wptest.io/demo/?p=1011',0,'post','',0),(1016,5,'2013-03-15 15:36:32','2013-03-15 20:36:32','This post should display a <a title=\"Featured Images\" href=\"http://en.support.wordpress.com/featured-images/#setting-a-featured-image\" target=\"_blank\">featured image</a>, if the theme <a title=\"Post Thumbnails\" href=\"http://codex.wordpress.org/Post_Thumbnails\" target=\"_blank\">supports it</a>.\n\nNon-square images can provide some unique styling issues.\n\nThis post tests a vertical featured image.','Featured Image (Vertical)','','publish','open','open','','featured-image-vertical','','','2013-03-15 15:36:32','2013-03-15 20:36:32','',0,'http://wptest.io/demo/?p=1016',0,'post','',0),(1027,7,'2013-03-15 15:47:16','2013-03-15 20:47:16','https://twitter.com/carlsmith/status/258214236126322689\r\n\r\nThis post tests WordPress\' <a title=\"Twitter Embeds\" href=\"http://en.support.wordpress.com/twitter/twitter-embeds/\" target=\"_blank\">Twitter Embeds</a> feature.','Twitter Embeds','','publish','open','open','','twitter-embeds','','','2013-10-11 14:17:50','2013-10-11 14:17:50','',0,'http://wptest.io/demo/?p=1027',0,'post','',0),(1031,6,'2013-03-15 17:23:27','2013-03-15 22:23:27','This is a test for Jetpack\'s Tiled Gallery.\r\n\r\nYou can install <a title=\"Jetpack for WordPress\" href=\"http://jetpack.me/\" target=\"_blank\">Jetpack</a> or <a title=\"Slim Jetpack\" href=\"http://wordpress.org/extend/plugins/slimjetpack/\" target=\"_blank\">Slim Jetpack</a> to test it out.\r\n\r\n[gallery type=\"rectangular\" columns=\"4\" ids=\"1037,1038,1039,1040,1041,1042\" orderby=\"rand\"]\r\n\r\nThis is some text after the Tiled Gallery just to make sure that everything spaces nicely.','Tiled Gallery','','publish','open','open','','tiled-gallery','','','2013-10-11 14:14:20','2013-10-11 14:14:20','',0,'http://wptest.io/demo/?p=1031',0,'post','',0),(1241,2,'2013-01-07 07:07:21','2013-01-07 13:07:21','This is a sticky post.\n\nThere are a few things to verify:\n<ul>\n	<li>The sticky post should be distinctly recognizable in some way in comparison to normal posts. You can style the <code>.sticky</code> class if you are using the <a title=\"WordPress Codex post_class() Function\" href=\"http://codex.wordpress.org/Function_Reference/post_class\" target=\"_blank\">post_class()</a> function to generate your post classes, which is a best practice.</li>\n	<li>They should show at the very top of the blog index page, even though they could be several posts back chronologically.</li>\n	<li>They should still show up again in their chronologically correct postion in time, but without the sticky indicator.</li>\n	<li>If you have a plugin or widget that lists popular posts or comments, make sure that this sticky post is not always at the top of those lists unless it really is popular.</li>\n</ul>','Sticky','','publish','open','open','','sticky','','','2013-01-07 07:07:21','2013-01-07 13:07:21','',0,'http://wptest.io/demo/?p=1241',0,'post','',0),(1242,1,'2013-09-25 15:43:59','2013-09-25 15:43:59',' ','','','publish','open','open','','1242','','','2013-09-25 15:43:59','2013-09-25 15:43:59','',0,'http://instituto-tim.mu/?p=1242',2,'nav_menu_item','',0),(1243,1,'2013-09-25 15:43:59','2013-09-25 15:43:59',' ','','','publish','open','open','','1243','','','2013-09-25 15:43:59','2013-09-25 15:43:59','',0,'http://instituto-tim.mu/?p=1243',3,'nav_menu_item','',0),(1244,1,'2013-09-25 15:43:59','2013-09-25 15:43:59',' ','','','publish','open','open','','1244','','','2013-09-25 15:43:59','2013-09-25 15:43:59','',0,'http://institut